import React, { Component } from 'react'
import {Link} from 'react-router-dom';

import socket from '../components/SocketUser';
import NavigationBar from '../../components/NavigationBar'


class Partners extends Component {

  constructor(props){
    super(props);

  }

  render() {
  	if(this.props.page == 'Partners'){
	    return (
	    	<div>
		        <NavigationBar loggedIn = {this.state.loggedIn} onSignOut = {this.props.onSignOut} navbarItems = {[[this.toLogin, "Home"], [this.toStaff, "Staff"], [this.toPartners, "Partners"], [this.toStudents, "Students"]]}/>



				<h1> partners page </h1>
		    </div>
	    	)
		}
    else {
    	return null
    }

  }
}



export default Partners;
